import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css'; 

var phantom = {
    display: 'block',
    padding: '20px',
    height: '60px',
    width: '100%',
  }

  var style = {
    backgroundColor: "#F8F8F8",
    borderTop: "1px solid #E7E7E7",
    textAlign: "center",
    padding: "20px",
    position: "fixed",
    left: "0",
    bottom: "0",
    height: "60px",
    width: "100%",
}

export default function Cart () {
    return (
        <div>
            <div class="container" style={phantom}>
            <div style={style}></div>
                <div class="row">
                    <div class="col-4">
                        HI
                    </div>
                </div>
            </div>
            <div/>
        </div>
    );
}
